import React from 'react';
import TimerComponent from './Timer.js';

const ChildComponent = (props) => {
    const {name, age} = props;
  return (
    <div>
        <TimerComponent />
        <p>이름은 {name}이며 {age}살 입니다.</p>
    </div>
  )
}

export default ChildComponent
